import { HttpClient } from '@angular/common/http';
import { Observable } from 'rxjs';
import { Injectable, Inject } from '@angular/core';

@Injectable({
  providedIn: 'root',
})

export class ExampleDataService {

  constructor(private httpClient: HttpClient, @Inject('BASE_URL') private baseApiUrl: string) { }

  upload(file: any, fileName: string): Observable<any> {

    const formData = new FormData();

    formData.append("file", file, fileName);

    return this.httpClient.post(this.baseApiUrl + 'Example/ImportJson', formData)
  }
}
